  function funcSearch() {
    log("funcSearch");
    const els = doc.gcn("tadiv");
    const dictCourse = {
      1: "VALLEY",
      2: "MOUNTAIN",
    };
    const result = [];
    Array.from(els).forEach((el) => {
      const param = el.children[0].attr("onclick").inparen();
      const [elDate, elCourse, elTime] = param;

      log("reserve search", dictCourse[elCourse], elDate, elTime);
      result.push({ date: elDate, time: elTime, course: dictCourse[elCourse] });
    });
    const param = {
      golf_club_id: "ec274d45-cdb9-11ec-a93e-0242ac11000a",
      device_id: "${deviceId}",
      result,
    };
    const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
    post(addr, param, { "Content-Type": "application/json" }, (data) => {
      console.log(data);
      funcEnd();
    });
  }
